// import logo from './logo.svg';
import './App.css';
import { useState } from 'react';
import {v4 as uuidv4} from 'uuid';
import NavBaarr from './Components/NavBaarr/NavBaarr';
import MovieList from './Components/MovieList/MovieList';
import { useEffect } from 'react';

function App() {

  const [movies, setMovies] = useState([ 
    {
      id: uuidv4(),
      img: "data:image/jpeg;base64,",
      Title: "Tom et Jerry au Far West",
      description:
        "In the Far West, Tom and Jerry, along with family and a gang of prairie dogs, help the inhabitants of a farm, including a cowgirl and her brother, to protect their land from a crooked speculator.",
      Rating: "4",
      date: "25 janvier 2022",
    },
    {
      id: uuidv4(),
      img: "data:image/jpeg;base64,",
      Title: "Adam through time",
      description:
        "After crash landing in 2022, fighter pilot and time traveler Adam Reed teams up with a 12-year-old version of himself to save the future.",
      Rating: "3",
      date: "2022",
    },
    {
      id: uuidv4(),
      img: "data:image/jpeg;base64,",
      description:
        "Pilot Buzz Lightyear spent a year planning a trip to a planet. After completing a test flight with his friends, he tries to return to his hometown, but something unexpected happens there. Buzz embarks on an epic adventure with his friend Socks.",
      Rating: "3",
      date: "2022",
    },
  ]) 




  const [search,setSearch] = useState("")
  const [stars,setStars] = useState(1)
  const [newMovie,setNewMovie] = useState({
    id:uuidv4(),
    img:"",
    description:"",
    Title:"",
    Rating:0,
  });

  const [filtredMovies , setFiltredMovies] = useState(movies)
  useEffect(() => {
    setFiltredMovies(movies.filter((movie)=> {
      return movie.Title.toLowerCase().includes(search.toLowerCase()) && movie.Rating >= stars
    }))
  } , [search,stars])


    return (
      <div className="App">
        <NavBaarr
          search={search}
          setSearch={setSearch}
          stars={stars}
          movies={filtredMovies}
          setFiltredMovies={setFiltredMovies}
          setStars={setStars}
          newMovie={newMovie}
          setNewMovie={setNewMovie}
        />
        <MovieList search={search} movies={filtredMovies}/>
      </div>
    );
}

export default App;
